package org.zubov.solutions.easy;

import java.util.HashMap;
import java.util.Map;

public class FindTheDifference {
    public static char findTheDifference(String s, String t) {
        Map<Character, Integer> charsS = getMapChars(s);
        Map<Character, Integer> charsT = getMapChars(t);
        for (Map.Entry<Character, Integer> entry : charsT.entrySet()) {
            Integer valueS = charsS.get(entry.getKey());
            Integer valueT = charsT.get(entry.getKey());
            if (!valueT.equals(valueS)) {
                return entry.getKey();
            }
        }
        return ' ';
    }

    private static Map<Character, Integer> getMapChars(String s) {
        Map<Character, Integer> charsS = new HashMap<>();
        for (char symbol : s.toCharArray()) {
            charsS.merge(symbol, 1, (oldValue, value) -> oldValue + 1);
        }
        return charsS;
    }

    public static void main(String[] args) {
        System.out.println(findTheDifference(""
    , ""));
    }
}
